import React, { useState } from 'react';
import Adminsidebar from '../../components/Adminsidebar';

const Addmember = () => {
  const [members, setMembers] = useState([]);

  const fetchMembers = async () => {
    try {
      const response = await fetch('http://localhost:8080/admin/getAllMemberRequest');
      const data = await response.json();
      setMembers(data);
    } catch (error) {
      console.error('Error fetching members:', error);
    }
  };

  const handleApprove = (id) => {
    // Handle approve logic here
    console.log('Approved member with id:', id);
  };

  const handleReject = (id) => {
    // Handle reject logic here
    console.log('Rejected member with id:', id);
  };

  return (
    <div className='text-white flex flex-row'>
      <div><Adminsidebar /></div>
      <div>
      <button onClick={fetchMembers}>Fetch Members</button>
      {members.length > 0 && (
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {members.map((member) => (
              <tr key={member.id}>
                <td>{member.name}</td>
                <td>{member.email}</td>
                <td>
                  <button onClick={() => handleApprove(member.id)}>Approve</button>
                  <button onClick={() => handleReject(member.id)}>Reject</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
      </div>

    </div>
  );
};

export default Addmember;
